    data: |
      SELECT ALL 32 AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q5832.out
    data: |
      32
      32
      32
      32
      32
      32
      32
      32
      32
